import React from "react";
import { Nav, NavItem, NavLink } from "reactstrap";

const NavBar = props => {
  return (
    <div>
      <Nav className="navbar-dark bg-primary justify-content-center">
        <NavItem>
          <NavLink href="#" className="">
            Tedyy Bears
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Dolls</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Trucks</NavLink>
        </NavItem>
      </Nav>
    </div>
  );
};

export default NavBar;
